(8, 'Asuntosijoittaminen', 'asuntosijoittaminen', 'Nämä artikkelit käsittelevät asuntosijoittamista. Pyrimme tuomaan modernia näkökulmaa asuntosijoittamiseen, jotta sijoittajana pääsisit kehittämään asuntosalkkuasi isommaksi ja tuottavammaksi nopeammin.', NULL, '2020-01-21 14:34:48', '2020-01-21 14:34:48'),
(9, 'Asunnon ostaminen', 'asunnon_ostaminen', 'Tuomme uusia näkökulmia asunnon ostamiseen, tässä kategoriassa ensisijaisesti omaan käyttöön ostettavista asunnoista. Parhaat käytännöt, tuoreimmat vinkit.', NULL, '2020-01-21 14:35:53', '2020-01-21 14:35:53'),
(10, 'Asunnon myyminen', 'asunnon_myyminen', 'Käsittelemme asunnon myyntiin liittyviä ominaispiirteitä ja pyrimme tuomaan asunnon myyjälle parhaat käytännöt ja vaihtoehdot pureskeltuna, testattuna ja selkokielellä. Pysy kuulolla.', NULL, '2020-01-21 14:37:16', '2020-01-21 14:37:16'),
(11, 'Asuntoflippaus', 'asuntoflippaus', 'Artikkeleita asuntoflippauksesta, eli osta-remontoi-myy mallista tehdä asuntokauppaa. Tutustu, ihastu, rakastu, toimi!', NULL, '2020-01-21 14:38:16', '2020-01-21 14:38:16'),
(12, 'Asuntomarkkinat ulkomailla', 'asuntomarkkinat_ulkomailla', 'Seuraamme aktiivisesti myös ulkoimaista asuntomarkkinoiden kehittymistä. Kirjoitamme ajatuksistamme ja huomioistamme säännöllisen epäsäännöllisesti.', NULL, '2020-01-21 14:40:05', '2020-01-21 14:40:05');
