(2, 'en', 2, 'Frequently Asked Questions (FAQ): Super Visa and Insurance', NULL, 'Canada is a great place to live and visit, but in order to stay here for any amount of time, you’ll need to prepare.', '<p>Canada is a great place to live and visit, but in order to stay here for any amount of time, you’ll need to prepare. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>Canada’s healthcare system is among the best in the world. While Canadian citizens and permanent residents have access to life-saving healthcare thanks to a long-established system already in place, visitors have no such coverage. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>You don’t want to be without coverage; in fact, you could be refused entry at the border if you don’t have adequate insurance. Health care in Canada is not free for everyone; Canadian government health insurance plans don’t cover “a tourist, a transient or a visitor to the province,” per the Canadian government’s website. If you get into a situation that requires you to be treated at a hospital or need to visit a doctor during your stay in Canada, you will be billed for medical services. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>Granted, a visit to a general practitioner at a walk-in clinic will likely not set you back any more than about $200. Then again, that’s $200 you could use for anything else – especially if you don’t need to spend it, right? &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><h4>However, if you were, say, to have an accident while hiking or skiing with your family and break your leg, the medical bills could quickly pile up. &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>&nbsp;</h4><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><h2>Another heading</h2><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>You can send out surveys in either pop-ups on your website or email blasts, but all survey tools should have a few crucial characteristics: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><ul><li>List items</li><li>List items</li><li>List items</li></ul><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>In order to avoid heavy medical bills and stay protected whether or not you experience a medical emergency, consult us today about <a href=\"#\">Super Visa Medical insurance!</a> In order to enter Canada under a <a href=\"#\">super visa</a>, you must have at least $100,000 in medical insurance coverage in effect prior to the issuing of the super visa.</p><p>&nbsp;</p>', 'Application,realestate', 5, '1573730717_stock-photo-happy-together-nice-beaming-couple-spending-weekend-at-home-while-watching-video-on-the-laptop-1235697223.jpg', '2020-01-21 14:31:27', '2019-11-12 18:47:10', '2020-01-21 14:31:27'),
(3, 'en', 3, 'Kestävän kehityksen rakentamista', NULL, 'JM Suomi Oy toteuttaa ensimmäisenä rakennusliikkeenä Suomessa Joutsenmerkittäviä', '<p><i><strong>JM Suomi Oy toteuttaa ensimmäisenä rakennusliikkeenä Suomessa Joutsenmerkittäviä kerrostalokoteja omistusasumiseen. Joutsenmerkki-talon rakentaminen on prosessi, joka vaikuttaa koko hankkeeseen suunnittelusta tuotantoon ja valmiiseen rakennukseen asti.</strong></i> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>JM Suomi Oy panostaa laadukkaaseen, kestävän kehityksen ja elinkaariajattelun huomioivaan rakennustapaan. JM Suomen uusin askel kohti kestävämpää rakentamista on kuluttajalle tuttu Joutsenmerkki. Joutsenmerkin avulla pyritään kirkastamaan kestävän kehityksen toimenpiteitä. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>–&nbsp;Joutsenmerkki vaatii rakennusalan yritykseltä kokonaisvaltaista laadunhallintaa, jossa kestävä kehitys on huomioitu rakentamisen jokaisessa vaiheessa. Prosessimme on Joutsenmerkkiä Suomessa hallinnoivan Ympäristömerkintä Suomi Oy:n tarkastama ja auditoima; noudatamme tarkasti Joutsenmerkin kriteerin asettamia vaatimuksia mm. materiaalihankinnoissa, kehityspäällikkö Emma Suokas sanoo. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>Granted, a visit to a general practitioner at a walk-in clinic will likely not set you back any more than about $200. Then again, that’s $200 you could use for anything else – especially if you don’t need to spend it, right? &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><h4><strong>Koti on elämän tärkeimpiä investointeja</strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</h4><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><h2>Another heading &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</h2><p>Siirtyminen Joutsenmerkki-rakentamiseen koskee koko JM AB konsernia, joka toimii Suomen ohella Ruotsissa ja Norjassa. Yli 70 vuotta vanhassa konsernissa on jo pitkään panostettu kehitykseen ja elinkaariajatteluun. Joutsenmerkki on pohjoismainen ympäristömerkki ja tunnettu kaikissa Pohjoismaissa, joten sen käyttöönotto oli luonteva jatkumo koko konsernissa. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><ul><li>JM Suomen ensimmäinen Joutsenmerkkiä hakeva kerrostalo, Asunto Oy Helsingin Höyhensaari, valmistuu Pasilaan keväällä 2020. Myös mm. Espoon Leppävaaraan on rakenteilla ja Herttoniemeen tulossa Joutsenmerkkiä hakevia kohteita, Emma Suokas kertoo.</li><li>Suomalaiset tuntevat Joutsenmerkin hyvin, mutta asuntorakentamisessa se on monelle vielä uusi asia. Mitä asukas hyötyy siitä, että hänen kotitalollaan on Joutsenmerkki?</li><li>Kuluttajien vaatimustaso kasvaa ja ympäristöasiat kiinnostavat. Rakentajana on tärkeää vastata asumiseen liittyviin toiveisiin. Joutsenmerkki-rakentaminen mahdollistaa asukkailleen hyvinvointia tukevan ympäristön, samalla parantaen koko rakennetun ympäristön laatua, joka säilyttää arvonsa vielä vuosien päästä, Anni Sirén toteaa.</li></ul><p><strong>Ensimmäinen Joutsenmerkittävä talo valmistuu keväällä 2020</strong></p><p>Vuodesta 2018 eteenpäin JM Suomi Oy siirtyi suunnittelemaan asuntotuotantonsa Joutsenmerkin kriteerien mukaan.</p><p>&nbsp;</p>', 'Application,Contractor', 6, '1573730775_real.jpg', '2020-01-21 14:32:55', '2019-11-14 11:43:42', '2020-01-21 14:32:55'),
(4, 'en', 4, 'Kohteiden markkinointi on tehokkainta brändimainontaa! Lue kolme', NULL, 'Yrityksen brändimielikuva syntyy muun muassa markkinoinnista, arvoista, tuotteen tai palvelun laadusta,', '<p>Yrityksen brändimielikuva syntyy muun muassa markkinoinnista, arvoista, tuotteen tai palvelun laadusta, yrityksen tavasta toimia ja viestiä sekä asiakkaiden kokemuksista. Tunnettu ja mielikuvaltaan hyvä brändi ovat merkittävässä roolissa, kun tehdään ostopäätöstä tai valitaan yhteistyökumppania.</p><p>Brändin rakentaminen vaatii pitkäjänteistä työtä. On tärkeää, että yrityksen tarina ja toiminnan arvot ovat yhdenmukaisia jokaisessa kanavassa. Jos esimerkiksi yritys markkinoi olevansa ekologinen, mutta toimii käytännössä tätä vastaan, mielikuva yrityksestä jää ristiriitaiseksi.</p><p>Kiinteistönvälittäjille kohdemarkkinointi on yksi tehokkaimpia tapoja kasvattaa brändin tunnettuutta ja tukea markkinoinnilla luotua mielikuvaa. Kohdeilmoitus on asunnonetsijälle tärkeä kohtaamispiste yrityksen kanssa – joissain tapauksissa jopa ensimmäinen kosketus yritykseen. Sen vuoksi hyvä ensivaikutelma on tärkeä.</p><h4>Lue kolme tehovinkkiä kuinka valjastaa kohdeilmoittaminen brändiä tukevaksi:</h4><p><strong>1.) Varmista, että yrityksesi tarina ja laatulupaus ovat samoja kaikissa kanavissa.</strong></p><p>Tunnistetaanko yrityksesi rennosta, mutta asiallisesta tavasta viestiä? Jatka samalla linjalla myös kohteiden esittelyssä. Tuo kohdesivulle <a href=\"https://asunnot.oikotie.fi/hinnasto/erotu-joukosta#ilmoitussivu-brandivarillasi\">värimaailma</a>, josta yrityksesi tunnetaan, jotta asiakaskokemus säilyy eheänä. Varmista, että yrityksesi logo näkyy jo hakusivulla, koska se lisää tutkitusti kohdesivuvierailujen määrää. Logo näkyy automaattisesti, jos yritykselläsi on Oikotien Teho- tai Superpaketti.<br>Kuvilla on suuri merkitys asunnon myynnissä. Laadukkailla kuvilla viestit yrityksesi tavasta toimia. Hyvällä valotuksella, edustavilla kuvakulmilla ja ylimääräisen tavaran karsimisella saadaan onnistuneita kuvia. Videot ja virtuaaliesittelyt kertovat kohteesta kuvia enemmän, joten suosittelemme lisäämään myös niitä kohde-esittelyyn. Ne kertovat yrityksesi monipuolisista markkinointimahdollisuuksista.</p><p><strong>2.) Erinomainen asiakaspalvelu tehostaa asuntojen myyntiä</strong><br><br>Nykypäivänä asiakkaat ovat tottuneet toimimaan monikanavaisesti ja yrityksiin halutaan olla yhteydessä itselle luontevimmilla keinoilla. Aika, jolloin riitti, että yritykseen sai yhteyttä vain toimistoaikana puhelimitse, on menneisyyttä. Paras asiakaskokemus luodaan sillä, että asiakas voi olla helposti yhteydessä yritykseen juuri siitä paikasta missä hän parhaillaan on. Esimerkiksi kohdeilmoitusta tutkiessaan asunnonostajan kynnys kysyä lisätietoa kohteesta madaltuu, jos yhteydenotto on tehty helpoksi Chat-palvelun avulla. Jos yritykselläsi on käytössä <a href=\"https://asunnot.oikotie.fi/hinnasto/palvele-asiantuntijuudella#chat-palvelu\">chat-palvelu</a>, se kannattaa lisätä kohdesivulle.</p><p>Asunnonetsijät tutustuvat useampiin kohteisiin sitä oikeaa etsiessä. Asiakasta on hyvä auttaa valinnassa tarjoamalla myös muita yrityksesi markkinoinnissa olevia kohteita. Jos unelmien kohde ei olekaan juuri se, jota asiakas on parhaillaan tutkimassa, voi se olla joku muu vastaavilla kriteereillä oleva kohteesi. Hyödynnä kohdesivu myös <a href=\"https://asunnot.oikotie.fi/hinnasto/tehosta-nakyvyytta#ilmoittajan-muut-kohteet-nosto\">muiden kohteidesi esittelyyn</a>.</p>', 'Asunnon myynti', 5, '1573731246_asunno.jpg', '2020-01-21 14:32:39', '2019-11-14 18:34:06', '2020-01-21 14:32:39'),
(5, 'en', 5, 'Suomi tulee jälkijunassa asuntosijoittamisessa', 'Suomi-tulee-jlkijunassa-asuntosijoittamisessa', 'Blogissa pureudutaan lyhyesti sijoittamisen periaatteisiin ja asuntosijoittamiseen.', '<p>Suomalaiset ovat kohtalaisen vaurasta kansaa, mutta jostakin syystä täällä tykätään istua varallisuuden päällä. Varallisuutta siis kertyy, mutta se ei juurikaan tuota mitään. Mikä tähän voisi olla syynä?</p><p>Tilanne: Suomessa moni ostaa nykyään ensiasunnon heti koulun päätteeksi, jotkut jopa ennen sitä. Rahaa myös säilötään säästötilille – pahan päivän varalle. Eikä siinä mitään väärää ole: hyvään taloudenpitoon kuuluukin pitää kohtuullisia puskureita. Mutta mutta...</p><p>&nbsp;</p><h3>Puskureiden loputon kasvattaminen voi johtaa \"sijoitusanemiaan\".</h3><p>&nbsp;</p><p>Ensimmäiseksi huomioitava tosiasia on, että nykyisin inflaatio syö rahan arvoa nopeammin, kuin säästötilin pikkuriikkinen korkotuotto ehtii kasvattaa säästöpottia. Pienessä säästöpuskurissa se ei ole ongelma, kun menetetyt summat ovat niin pieniä. Säästöjen tuoma mielenrauha ja jousto talouteen ovat suurempi lisäarvo.</p><p>Kun sitten säästöt vain paisuvat ja paisuvat, alkaa rahojen säilöminen ja lepuuttaminen säästötilillä arveluttamaan. Käykö siinä niin, että kerätyn säästöpotin menettämisen pelko kasvaa sitä mukaa kun potti kasvaa? Rahaa ei koskaan laiteta tuottamaan kunnolla, vaan osa sijoitetaan ehkä matalakorkoisiin rahastoihin, jos niihinkään. Huonoimmassa tapauksessa rahan makuuttamista jatketaan hamaan tappiin asti.&nbsp;</p><p>&nbsp;</p><h3>\"Raha on hyvä laittaa töihin\"</h3><p>&nbsp;</p><p>Säästäväisyyteen on suomalaisessa kulttuurissa pitkät perinteet: vielä hetki sitten olimme hyvin köyhää kansaa. Ajat Ruotsin ja Venäjän alla eivät rikastuttaneet meitä. Olisiko nyt aika oikaista tilanne ja alkaa vaurastumaan? Pitäisikö laittaa raha töihin?&nbsp;</p><p>Yksi hyvä tapa laittaa raha töihin on sijoittaa asuntoihin.&nbsp;</p><p>Asuntosijoittajat voidaan jakaa karkeasti kolmeen ryhmään:</p><ol><li>Sijoittaja ostaa uusia tai uudehkoja asuntoja ja jättää ne tyhjilleen. Asunnot myydään muutaman vuoden päästä voitolla.</li><li>Sijoittaja ostaa huonokuntoisia asuntoja, remontoi ne ja myy remontin jälkeen voitolla. Tätä kutsutaan asuntojen \"flippaamiseksi\".</li><li>Sijoittaja ostaa erilaisia asuntoja ja vuokraa niitä. Lainanlyhennykset ja muut kulut pyritään kattamaan vuokratuotoilla.</li></ol><p>Asuntosijoittaminen on tutkitusti kannattavaa puuhaa, mutta silti hyvin harva suomalainen on lähtenyt asuntosijoittajaksi.&nbsp;</p><p>&nbsp;</p><h3>\"Sijoittaminen on aina riski - sitä voi pienentää valmistautumalla\"</h3><p>&nbsp;</p><p>Vaikka asuntosijoittamisen kynnys on nykyään matala, se sisältää riskin - riskin menettää rahaa ja riskin voittaa rahaa. Riskin ottamisessa me suomalaiset emme ole erityisen kunnostautuneita, päin vastoin. Me kartamme riskejä. Kirjasta opitun tiedon ja käytäntöön soveltamisen välillä on pääkopassa iso kuilu. Mitä jos epäonnistunkin ja menetän rahaa?</p><p>Asuntosijoittamisesta on tarjolla paljon tietoa monessa eri muodossa ja siihen kannattaa perehtyä huolella ennen rahallisen sijoituksen tekemistä. Ennen aineiston laajamittaista kahlaamista läpi olisi kuitenkin hyvä tehdä päätös, että tekee ainakin yhden sijoituksen. Valtava tietopankki päässä ilman käytännön toimia ei tuota mitään, se on pikemminkin ajanhukkaa.</p><p>Jos tuottoisa asuntosijoittaminen kiinnostaa ja olet valmis tekemään omat kotiläksysi, esimerkiksi Flipkoti tarjoaa rajatulle määrälle ihmisiä mahdollisuuden sijoittaa yhdessä meidän kanssamme hyvän tuottopotentiaalin omaaviin kohteisiin. Näin sinulle avautuu mahdollisuus päästä pienemmällä summalla kiinni käytännön asuntosijoittamiseen hajautetulla riskillä.&nbsp;</p><p>Mikäli asia kiinnostaa, niin ole yhteyksissä. Katsotaan sinun tilanteeseesi sopiva malli lähteä asuntosijoittamisen mielenkiintoiseen maailmaan.</p><p>&nbsp;</p>', 'Sijoittamisen filosofia,Asuntosijoittaminen', 8, '1581507856_1579598312_Asuntosijoittaminen-kirstun-päällä.jpg', NULL, '2020-01-21 16:18:32', '2020-02-12 18:44:16'),
(6, 'en', 6, 'Asunnon osto ja etsintä – Mistä kannattaa maksaa?', 'Asunnon-osto-ja-etsint--Mist-kannattaa-maksaa', 'Vinkkejä asunnon ostajalle, etenkin ensiasunnon ostajalle.', '<p>Onko sinulle tullut oman kodin hankinta ajankohtaiseksi? Kenties olet jo kokenut asuntojen ostaja tai ensimmäistä kertaa asuntoa hankkimassa. Pyrin tässä kirjoituksessa nostamaan muutaman tärkeän pointin asunnon ostamiseen liittyen, jotta seuraavat asuntokaupat olisivat elämäsi parhaat.</p><p>Varsinkin ensiasuntoa ostava voi olla hakoteillä sen suhteen, paljonko asunnoista tulisi maksaa. Meneekö unelmien asunto sivu suun, jos yrittää tinkiä hinnasta? Vai maksaako asunnosta liikaa, jolloin asunnon hankinnan vaikutukset heijastuvat pitkän aikaa henkilökohtaiseen talouteen?</p><p>&nbsp;</p><h3>Tarjotako alle vai yli pyyntihinnan?</h3><p>&nbsp;</p><p>On syytä aina muistaa, että lähes kaikkien asuntojen hinnoissa on hieman ilmaa. Neuvotteluvaraa on keskimäärin noin 4,5 % verran. On kuitenkin olemassa myös sellaisia asuntoja, joiden lopullinen hinta menee yli pyyntihinnan.&nbsp;</p><p>Varsinkin suurissa kaupungeissa lopullinen hinta on useimmiten korkeampi kuin pyyntihinta. Tämä johtuu siitä, että useampi ostajaehdokas on kiinnostunut asunnosta. Silloin kannattaa tehdä pyyntihintaa korkeampi tarjous. Korkeampi tarjous kannattaa tehdä myös silloin, kun asunto on ollut markkinoilla vasta vähän aikaa. Alle kuukauden myynnissä olleisiin kohteisiin ei monestikaan edes hyväksytä kovin alhaisia tarjouksia.</p><p>&nbsp;</p><h3>\"Tehdyt remontit vaikuttavat paljon hintapyyntöön\"</h3><p>&nbsp;</p><p>Mitkä seikat vaikuttavat asunnon hintaan? On selvää, että tehdyt remontit vaikuttavat suuresti kohteen hintapyyntöön. Jos asunnossa on tehty kattavasti remontteja, on luvassa remonttivapaata asumista jopa kymmeniä vuosia. Jos remontteja taas ei ole tehty, voi luvassa olla kuukausia, jolloin asunnossa ei voi asua.</p><p>Muutaman kuukauden väliaikaismajoitus tulee helposti kalliiksi. Puhumattakaan kaikesta muusta vaivasta, mitä väliaikaisasumiseen liittyy, etenkin jos perheessä on lapsia.&nbsp;</p><p>Tämä on yleistä erityisesti putkiremonttien kohdalla. Vuonna 2019 erityisesti 60-luvun lopussa ja 70-luvulla rakennetut asunnot alkavat olla suurten remonttien tarpeessa.&nbsp;&nbsp; &nbsp;</p><p>&nbsp;</p><h3>Huolellinen valmistautuminen kannattaa aina.</h3><p>&nbsp;</p><p>Ennen asuntonäyttöihin lähtemistä ostajan olisi hyvä lähteä selvittämään eri vaihtoehtoja. Asunnon sijainti vaikuttaa tietenkin hintoihin, joten on tärkeää katsella asuntoja monilta eri asuinalueilta. Omat unelmat eivät aina kohtaa sen kanssa, mihin ostajalla on realistiset mahdollisuudet. Sen vuoksi ei ole järkevää haaveilla suuresta kalliilla asuinalueella sijaitsevasta kodista, jos oma tulotaso ei riitä lyhentämään kohteen kuukausittaista lainasummaa.&nbsp;</p><p>Asunnon ostoon liittyvät kulut eivät nimittäin koostu ainoastaan asunnon hinnasta. Ostaja joutuu maksamaan myös varainsiirtoverot ensiasunnon ostajia lukuunottamatta, mahdolliset vastikkeet ja remontit sekä muuttokulut.</p><p><strong>Ensimmäinen osoite minne suunnata on pankki.</strong></p><p>Ennen asuntonäytöille suuntaamista on järkevää suunnata pankkiin ja hakea lainaa. Lainasumma lasketaan tarkkaan siten, että ostajalle jää pelivaraa talouteen. On nimittäin tärkeää, että kaikki taloudet menot eivät mene lainanlyhennyksiin. Pankkejakin kannattaa kilpailuttaa ja valita itselleen edullisin lainatarjous. Jotkut pankit vaativat myös, että kohde hyväksytetään pankilla ennen kuin lopullisen ostotarjouksen voi tehdä. Jos pankki antaa tällaisen ehdon lainansaannille, tulee se silloin merkitä ostotarjoukseen. Tilanteessa, jossa pankki ei hyväksykään asuntoa, ostaja ei joudu maksamaan sakkoa kaupan perumisesta.</p><p>&nbsp;</p><h3>\"Mieti rauhassa, älä kiirehdi.\"&nbsp;</h3><p>&nbsp;</p><p>Mieti siis rauhassa, millainen asunto sopii parhaiten juuri sinun tarpeisiisi. Asuntonäytöissä käyminen kannattaa, sillä ainoastaan siten saa hyvän käsityksen siitä, kuinka paljon asuntojen hinnat vaihtelevat asuinalueittain. Kun oma unelmakoti sitten löytyy, kannattaa tarjous tehdä harkiten. Hyvän tarjouksen jättänyt pääsee nauttimaan pian oman kodin suomasta mielenrauhasta vuosiksi eteenpäin.</p>', 'Asunnon osto,Ensiasunto', 9, '1581507900_1579767621_Ensiasunnonostajat.jpg', NULL, '2020-01-23 15:20:21', '2020-02-12 18:45:00'),
(7, 'en', 7, 'Asuntojen arvon kehitys – mihin se perustuu?', 'Asuntojen-arvon-kehitys--mihin-se-perustuu', 'Asuntojen arvokehitysmekanismin ymmärtäminen on asuntosijoittamisen keskiössä.', '<p>-Moi!</p><p>-Moi.</p><p>-Hei oon miettinyt et ostaisi kämpän ja myis parin vuoden päästä isolla voitolla. Se on kuulemma hyvää bisnestä.</p><p>-Oho! Kuulostaa, että tiedät mitä olet tekemässä.</p><p>-Juu, kyl mä joo..</p><p>Kuulostaako tutulta keskustelulta?</p><p>Moni ostaa asunnon siinä luulossa, että siitä saa mahdollisesti joidenkin vuosien kuluttua mukavan tuoton. Näin ei kuitenkaan läheskään aina ole.&nbsp;</p><p>&nbsp;</p><h3>Miten asuntojen arvo muodostuu?</h3><p>&nbsp;</p><p>Asunnon oston kanssa kannattaa siis olla tarkkana, jotta ei pahimmassa tapauksessa menetä rahojaan. Asunnon arvoon vaikuttavia tekijöitä on monia. Asunnon koko ja kunto ratkaisevat tietysti paljon. Jos asunto on uudehko tai sitä on remontoitu hiljattain, saa sillä luonnollisesti paremman summan kuin vanhalla remontoimattomalla asunnolla. Kunto ei kuitenkaan kerro vielä kaikkea.&nbsp;</p><p>Kun ostat kerrostalo- tai rivitalohuoneiston, ostat tyypillisesti osakkeen asunto-osakeyhtiöstä, joka omistaa kiinteistön. Kun asunto-osakeyhtiö tai toisella nimellä taloyhtiö vastaa kiinteistöstä, taloyhtiön kunnolla on vaikutusta asunnon arvoon. Huonosti hoidetussa taloyhtiössä saatat joutua maksamaan yllättäviä remontteja tai muita laiminlyötyjä asioita.&nbsp;</p><p>Tarkasta siis taloyhtiön paperit ja jos et ymmärrä jotakin, pyydä apua.&nbsp;</p><p>&nbsp;</p><h4>Kaupungillistuminen megatrendinä vaikuttaa kiihtyvästi arvokehitykseen</h4><p>&nbsp;</p><p>Mikä oli asuntomarkkinoiden tilanne vuonna 2019? Vuoden 2019 ensimmäisellä puoliskolla asuntojen hinnat ovat lähinnä laskeneet, jos ajatellaan Suomea kokonaisuudessaan. Varsinkin maaseudut ja pienet paikkakunnat autioituvat, kun ihmiset muuttavat kaupunkeihin opiskeluiden ja töiden perässä. Tämän vuoksi suurista kaupungeista on tullut alueita, joilla asuntojen hinnat nousevat.</p><p>&nbsp;</p><h3>\"Sijainti, sijainti, sijainti (ja paljon muuta)\"</h3><p>&nbsp;</p><p>Tänä päivänä ostajat ovat tietoisia niin sanotuista hyvistä ja huonoista asuinalueista. Jos asuinalueen maine on huono ja sieltä löytyy paljon heikkokuntoisia asuntoja, eivät laatutietoiset sijoittajat suuntaa sinne. Sen sijaan mukavat alueet, joiden läheisyydestä löytyy kattavasti palveluita ovat monen mieleen. Ei voida myöskään väittää, etteikö postinumerolla olisi väliä. Vuosi toisensa jälkeen eniten arvoa kasvattavat tietyn postinumeroalueen asunnot.</p><p>Esimerkiksi Helsingin keskusta on hyvää aluetta asuntosijoittamista silmällä pitäen. Siellä asuntojen hinnat eivät menetä arvoaan juuri koskaan, vaan päinvastoin. Helsingin lisäksi myös Espoon ja Vantaan hintakehitys näyttää nousujohteiselta. Näiden kaupunkien ohella Turku, Tampere ja Oulu ovat kaupunkeja, joissa asuntojen arvot säilyvät hyvinä yleisesti ottaen. Toki myös kaupunkien sisällä on poikkeuksia riippuen siitä, missä kaupunginosassa asunto sijaitsee. Tasaista hintakehitys on myös Kauniaisissa. Siellä asuntojen arvo ei juuri koskaan laske.</p><p>&nbsp;</p><h3>Katse tulevaisuuteen – &nbsp;mitä alueelle on tulossa?</h3><p>&nbsp;</p><p>Asuntojen arvon kehitykseen tulee kiinnittää huomiota ennen ostopäätöksen tekemistä. Kaikista parhaimmat sijoittajat myös katsovat tulevaisuuteen. Jos jonkun asuinalueen läheisyyteen ollaan rakentamassa vaikkapa ostoskeskusta tulevaisuudessa, voi palveluiden läheisyys nostaa asuntojen hintoja. Pieni ennakoiminen on aina paikallaan.</p>', 'Asunnon arvon kehitys', 8, '1581507997_1579777800_Asuntojen hinnan kehitys.jpg', NULL, '2020-01-23 18:10:00', '2020-02-12 18:46:37'),
(8, 'en', 8, 'Kaupungistuminen, uhka vai mahdollisuus?', 'Kaupungistuminen-uhka-vai-mahdollisuus', 'Kaupungistuminen on aikamme megatrendeistä. Asuntosijoittajan on tärkeä ymmärtää, miten se tulee ottaa huomioon asuntojen hankinnassa.', '<p>Vaikka hieman ensimmäisten kaupunkien syntymisen jälkeen suurin osa väestöstä asuikin maaseudulla, on kaupungeilla ollut alusta alkaen suuri merkitys monessakin mielessä. Suuri osa varhaisesta kaupankäynnistä tapahtui nimenomaan kaupungeissa. Samoin myös vallassa olevat ovat aina asettuneet asumaan kaupunkeihin.&nbsp;</p><p>Suomessa kaupungissa asuvan väestön osuus on noin 70 % koko väestöstä. Tämä luku on kasvanut huomattavasti varsinkin muutamien viime vuosien aikana. Se johtuu lähinnä siitä, että suurin osa koulutuksesta ja työelämästä keskittyy kaupunkeihin. Jos haluaa opiskelemaan vaikkapa yliopistoon, on tällöin muutettava aina kaupunkiin. Mitä pidemmällä yhteiskunta kehittyy, sen enemmän on tarve kouluttautua. Kaupungistumiseen liittyy selkeästi taloudellisia syitä. Kaupungistuminen on saanut myös maaseudun pienet kylät autioitumaan.&nbsp;&nbsp;</p><p>&nbsp;</p><h3>Keskusta viihde-elämän keskuksena&nbsp;</h3><p>&nbsp;</p><p>Kaupunkien sisällä on jaottelua. Kaikissa suurissa kaupungeissa on yleensä keskusta. Keskusta toimii viihde-elämän keskuksena ja sieltä löytyy paljon palveluita. Toki esimerkiksi Helsingissä on monia muitakin kaupunginosia, jotka ovat melkein samalla tasolla kaupungin keskustan kanssa.</p><p>&nbsp;</p><h4>\"Kaupungistuminen vaikuttaa rajusti asuntojen hintaan: suuntaan ja toiseen .\"</h4><p>&nbsp;</p><p>Miten kaupungistuminen sitten vaikuttaa ympäröiviin paikkakuntiin asuntomarkkinoiden kohdalla? Asuntojen hintojen kohdalla kaupungistuminen tarkoittaa sitä, että kaupungeissa asuntojen hinnat nousevat. Varsinkin Helsinki on ollut kasvukeskusta jo pitkään. Asuntojen hinnat ovat jatkaneet kasvuaan vuosi toisensa jälkeen. Helsinki ei kuitenkaan ole ainut paikka, jossa asuntojen hinnat nousevat. Helsinkiäkin rajumpaa hintojen nousu on Kauniaisissa ja Espoossa. Suomen hyvätuloisimmat asuvat Kauniaisissa sekä Espoon Westendissä. Näiden paikkojen kohdalla sijainnista Helsingin ulkopuolella on vain hyötyä. Ympäristöstä löytyy maaseutumaisuutta, mutta silti sijainti on lähellä Helsinkiä.</p><p>&nbsp;Pohjois-Suomessa ja ympäri Suomea sijaitsevilla pienillä paikkakunnilla asuntojen hinnat ovat laskeneet hurjasti. Pahimmillaan asunnon myymällä myyjä ei saa edes tarpeeksi, jotta voisi kattaa asunnosta jäljellä olevan lainan myyntituotoilla.&nbsp;&nbsp;</p><p>&nbsp;</p>', 'Kaupungistuminen', 8, '1581508250_1579779195_Kaupungistuminen.jpg', NULL, '2020-01-23 18:33:15', '2020-02-12 18:50:50'),
(9, 'en', 9, 'Mitä flippaus on?', 'Mit-flippaus-on', 'Asuntoflippaus tarkoittaa asuntosijoittamisen mallia, missä ostetaan, remontoidaan ja myydään asuntoja nopealla syklillä.', '<p>Asuntojen flippaus ei ole vielä kovinkaan monelle tuttu termi. Se tarkoittaa siis käytännössä osta, remontoi, myy -strategiaa. Asunnonostaja ei siis laita asuntoa vuokralle, vaan ostaa hieman huonokuntoisen asunnon, remontoi siitä nykypäivän normit täyttävän ja myy sen eteenpäin.&nbsp;</p><p>Asuntojen flippaus ei kuitenkaan sovi aivan kenelle tahansa, sillä kannattavien asuntojen löytäminen vaatii aikaa ja vaivaa. Aivan minkä tahansa asunnon ostaminen ei kannata. Suomestakin löytää useita kokemattomia sijoittajia, jotka ovat ostaneet halvalla saamansa asunnon, mutta menettäneet rahansa huonoissa kaupoissa. On nimittäin olemassa asuntoja, joita ei vain saa kaupaksi syystä tai toisesta. Asuntokauppa onkin haastava bisnes, joka tulee tuntea hyvin ennen kuin asuntojen flippauksella voi alkaa tienaamaan kunnolla rahaa.</p><p>&nbsp;</p><h3>Flippaus sopii remonttitaitoisille ja -tietoisille.</h3><p>&nbsp;</p><p>Flippaus sopii erityisesti sellaisille henkilöille, jotka ymmärtävät remontoimisesta ja osaavat itsekin tehdä jotakin. Jos remontoinnista tai remonttien hinnoista ei ole minkäänlaista arviota, voivat remonttifirmat laskuttaa enemmän kuin normaalin hintatason mukaisesti. Flippaamiseen ei myöskään koskaan kannata sijoittaa viimeisiä rahojaan, sillä kyseessä on aina riskisijoitus. Sijoittajalla tulee siis olla myös stressinsietokykyä. On hyvä varautua siihen, että asunto ei välttämättä mene heti kaupaksi remontin jälkeen. Tällöin sijoittajalla on edelleen laina ja vastikkeet maksettavanaan, mutta ei vielä flippauksesta seuraavia tuottoja.&nbsp;</p><h4>Kaikista paras tilanne on tietenkin silloin, kun asunnon ostaa omilla rahoillaan.&nbsp;</h4><p>Aika harvalle tämä kuitenkin on mahdollista, mutta toki on heitäkin, jotka ovat vaurastuneet asuntokaupoilla niin, että uuden asunnon voi ostaa ilman lainaa. Monet asuntosijoittajat käyttävät hyväkseen velkavipua. Jos sitä osaa hyödyntää hyvin, on asunnon tuotto korkeampi kuin kulut. Jos asunto ostetaan esimerkiksi 50 000 eurolla ja remonttiin menee 30 000 euroa, tulee myyntihinnan olla korkeampi kuin 80 000 euroa.&nbsp;&nbsp;</p><p>&nbsp;</p><h3>Millaisia asuntoja kannattaa flipata?</h3><p>&nbsp;</p><p>Millainen asunto on sitten helppo saada kaupaksi? Asuntojen flippauksessa suositaan yleensä pienehköjä asuntoja, sillä ne on helppo saada kaupaksi. Myös asunnon pohjaratkaisulla on merkittävä rooli siinä, miten nopeasti asunnon saa myytyä eteenpäin. Paras mahdollinen asunto flippaukseen on yleisesti ottaen pienehkö kerrostaloasunto hyvällä sijainnilla. Parhaiten omistajaa vaihtavat kaksiot, joista löytyy yksi makuuhuone. Jos suuret remontit, kuten putkiremontit, on tehty, näyttää kohde houkuttelevalta ostajien näkökulmasta. Vastikkeiden määräkin toki vaikuttaa omalta osaltaan kohteen houkuttelevuuteen. Vastikkeista ei saisi koskaan kertyä turhan suuria summia, sillä ostajat eivät halua paljon ylimääräisiä kuluja lainanlyhennyksen lisäksi.&nbsp;</p><p>Monissa 80-luvulla rakennetuissa kerrostaloissa ollaan juuri nyt siinä tilanteessa, että on aika alkaa tehdä isoja remontteja. Ne tuovat tulevaisuudessa kustannuksia asunnon omistajille ja nostavat vastikkeiden määrää. Asuntojen flippausta harrastavan kannattaa välttää tällaisia taloyhtiöitä. Sen sijaan on hyvä suosia niitä taloyhtiöitä, joissa on jo tehty suuret remontit.</p><p>&nbsp;</p><h3>Asuntojen remontoiminen järkevästi on taitolaji</h3><p>&nbsp;</p><p>Myös asunnon remontoiminen ja sisustaminen on taitolaji, jolla on vaikutusta asunnon myymiseen. Asunnon remontoimisen kanssa kannattaa suosia neutraalia linjaa, kun puhutaan lattia- ja seinämateriaaleista. Voimakkaat värit eivät välttämättä miellytä kaikkia, joten silloin ostajaehdokkaiden määrä laskee. Helppohoitoisuus ja valoisuus tekevät asunnolle ihmeitä. Niitä kannattaakin korostaa myös asuntonäytöissä. Jos asunto on pieni, silloin olisi hyvä suosia monitoimikoneita. Markkinoilla on saatavana esimerkiksi liesiä, joiden alaosasta löytyy pieni tiskikone. Asuntojen flippauksella tuloja havittelevan on pakko keksiä tällaisia vaihtoehtoisia keinoja, joiden avulla pieneenkin kotiin saadaan paljon moderneja laitteita.&nbsp;</p><p>Näillä vinkeillä varmasti aloittelevakin asuntosijoittaja pääsee alkuun, joten ei muuta kuin tekemään hyviä kauppoja!&nbsp;</p><p>P.S. Jos asuntojen flippaaminen kiinnostaa enemmänkin, tule ihmeessä keskustelemaan alkuun pääsemisestä meidän tuella tai kanssamme.&nbsp;</p>', 'Asuntoflippaus', 11, '1579780012_Asuntoflippaus.jpg', NULL, '2020-01-23 18:46:52', '2020-01-29 17:42:05'),
(10, 'en', 10, 'Asuntokauppa vs. autokauppa – keskeisimmät erot', 'Asuntokauppa-vs-autokauppa--keskeisimmt-erot', 'Kannattaako uuden auton hankinta taloudellisesti? Entäpä uuden asunnon hankinta? Ei välttämättä.', '<p>Uusista autoista sanotaan, että niiden arvo laskee välittömästi, kun auton ajaa ulos liikkeestä. Uusi auto ei siis missään nimessä ole sijoitus. Tavallaan tämä sama pitää ainakin osittain paikkaansa myös asuntokaupassa. Uusi asunto ei aina ole kovinkaan järkevä sijoitus. Joskus vanhemmat asunnot voivat kasvattaa arvoaan paremmin kuin uudet asunnot.</p><p>Uusien asuntojen hintapyynnöissä ei yleensä ole juurikaan neuvottelemisen varaa. Asuntoja aletaan myymään hyvissä ajoin ennen kuin niitä on edes kunnolla alettu rakentaa. Monesti ostajia houkutellaan myös sillä, että asuntojen pintamateriaaleihin pääsee vaikuttamaan itse, kun tekee ostotarjouksen tiettyyn aikarajaan mennessä. Riippuen pintamateriaaleista asunnon hinta voi loppujen lopuksi nousta oletettua korkeammaksi. Mitä laadukkaampia materiaaleja käytetään, sitä enemmän asunto tulee kustantamaan.</p><p>Uusi on aina uusi, mutta uusi ei ole aina taloudellisesti kannattava.</p><p>&nbsp;</p><h3>Onko järkeä remontoida vanha asunto?</h3><p>&nbsp;</p><p>Kannattaako sitten vanhan asunnon ostaminen ja remontoiminen? Se kannattaa monesti, sillä tuottoa voi saada moninkertaisesti uuden asunnon ostamiseen ja myymiseen verrattuna. Esimerkiksi rintamamiestalot ovat tänä päivänä haluttuja. Rintamamiestalon voi saada halvimmillaan muutamilla kymmenillä tuhansilla euroilla. Sijoitus ei siis sinällään ole kovin suuri, mutta totta kai remontti aiheuttaa lisäkuluja ostajalle. Rintamamiestaloissa täytyy yleensä tehdä kokonaisvaltainen remontti, johon kuuluu niin putkiremontti kuin kaikkien pintamateriaalien uusiminen. Itse remonttiin menevät kulut voivat olla samaa luokkaa kuin itse talon ostamiseen käytetty summa. Remontin jälkeen rintamamiestalo on kuitenkin valmis myytäväksi ja pyyntihinta on aina paljon alkuperäiskuntoisen ostohintaa korkeampi.</p><p>Jos lähdetään kuitenkin vertaamaan autokauppaa ja asuntokauppaa, löydetään yhdenmukaisuuksia siinä, että uuden ostaminen ei aina kannata. Niin käytetty auto kuin käytetty asunto ovat molemmat parempia ostokohteita kuin uudet vastaavat.</p><p>&nbsp;</p>', 'Autokauppa vs asuntokauppa', 9, '1579780530_Uuden auton osto vs uuden asunnon osto.jpg', NULL, '2020-01-23 18:55:30', '2020-01-29 17:41:41'),
(11, 'en', 11, 'Voiko asunnon myydä itse?', 'Voiko-asunnon-myyd-itse', 'Moni miettii asunnon myyntiä itse, mutta päätyy kuitenkin myymään asunnon välittäjän kautta. Onko itse myyminen kuitenkaan niin hankalaa?', '<p>Monet asuntoa myymässä olevat pähkäilevät sen kanssa, voisiko asunnon myydä itsenäisesti ilman välittäjän apua. Välittäjän palkkiot liikkuvat tuhansissa euroissa, joten itse myymällä säästää mukavan summan riihikuivaa käteistä. Jos esimerkiksi asunnon arvo on 200 000€ ja välittäjän palkkio keskimäärin 4 %,&nbsp;</p><p>Asunnon myyminen itsenäisesti onnistuu kyllä, kunhan muistaa vain ottaa asioista selvää. Asunto-osakkeen myyminen on kohtalaisen yksinkertaista, mutta omakotitalon myyminen vaatii jo enemmän asiakirjoja. Asunto-osakkeen kohdalla tarvittavat asiakirjat saa tilattua suoraan isännöitsijältä. Nämä asiakirjat ovat isännöitsijäntodistus, yhtiöjärjestys, tilinpäätös, talousarvio ja pohjapiirros. Joissakin tapauksissa kohteelle on hankittava myös lain vaatima energiatodistus.</p><p>&nbsp;</p><p>Yksi tärkeimmistä seikoista on määritellä asunnon arvo sellaiseksi, että se houkuttelee ostajia. Kiinteistönvälittäjillä on runsaasti kokemusta tästä, joten välittäjä osaa kertoa heti, mikä on sopiva hinta. Kun asuntoa lähdetään myymään ilman välittäjän apua, on syytä seurata hieman naapurustosta myytävien asuntojen hintoja. Näin saa vinkkiä siitä, millaisella hintapyynnöllä kannattaa lähteä liikkeelle. Monet myyjät tekevät sen virheen, että laittavat asunnon hintapyynnön liian korkeaksi. Liian korkea hinta karkottaa ostajaehdokkaat. Onko sitten järkevämpää laittaa hinta jopa hieman alhaiseksi? Ei, sillä liian alhainen hintapyynti herättää myös kysymyksiä siitä, mikä asunnossa on vikana. Asuntokaupassa hinnan määrittäminen on taitolaji, joka kannattaa ottaa haltuun ennen myynti-ilmoituksen laatimista.</p><p>&nbsp;</p><p>Kun asiakirjat on hommattu ja kodin arvo laitettu kohdilleen, on aika lähteä suunnittelemaan tuota jo aikaisemmin mainittua myynti-ilmoitusta. Myynti-ilmoituksen ratkaisevin tekijät ovat hyvälaatuiset kuvat. Kuvia tulisi olla kattavasti jokaisesta huoneesta, jotta ostajaehdokkaat saavat hyvän käsityksen asunnosta jo ennen näyttöä. Kannattaa myös muistaa liittää kuva pohjapiirroksesta myynti-ilmoitukseen, sillä pohjaratkaisu kertoo paljon siitä, haluaako asuntoon tutustua tarkemmin. Muita myynti-ilmoitukseen tulevia tietoja ovat esimerkiksi rakennusvuosi, asunnon koko, tehdyt remontit, tulossa olevat remontit ja vastikkeen määrä. Myynti-ilmoitukseen voi laittaa myös ensimmäisen julkisen näytön päivämäärän. Hyvällä myynti-ilmoituksella voidaan välttää niin sanotusti turhia näyttöjä. Mitä rehellisemmän ja kattavamman kuvan asunnosta antaa, sitä paremmin oikeat ostajaehdokkaat löytyvät.</p><p>&nbsp;</p><p>Kun myyjä saa aikanaan miellyttävän ostotarjouksen, alkaa varsinainen kaupanteko ostotarjouksen hyväksymisellä. Kauppakirjan laatiminen onnistuu helposti netistä löytyvien valmiiden sopimuspohjien avulla. Valmiit sopimuspohjat ovat kaikista helpoin ratkaisu, sillä niissä on varmasti otettu huomioon kaikki asunnon myyntiin liittyvät lainkohdat. Kun molemmat ovat allekirjoittaneet sopimuksen, sovitaan lopullinen kaupanteko pankkiin. Asunnosta voi joutua maksamaan veroa myyntivoiton osalta, jos asunnon on omistanut vähemmän kuin kaksi vuotta. Onko siis järkevää omistaa asunto vähintään kaksi vuotta ennen kuin sen myy? Veroprosentti 30 000 euroon asti on vuonna 2019 30 %. 30 000 euroa ylittävältä summalta veroprosentti on 34 %.</p>', 'Asunnon myynti itse,Myynti ilman välittäjää', 10, '1579780922_Asunnon myynti itse.jpg', NULL, '2020-01-23 19:02:02', '2020-01-29 17:41:53'),
(12, 'en', 12, 'Älä myy asuntoa kiireessä – jos ei ole aivan pakko', 'l-myy-asuntoa-kiireess--jos-ei-ole-aivan-pakko', 'Kun tulee aika myydä asunto, siitä haluaa päästä mahdollisimman nopeasti eroon. Koko myyntiprosessi saattaa tuntua ahdistavalta. Silloin on kuitenkin järkevä vetää happea ja pitää pää kylmänä.', '<p>Muutokset kuuluvat olennaisena osana elämään. Kaikkia vastaan tulevia tilanteita ei voi ennakoida, eikä elämä aina mene niin kuin on suunnitellut. Perheitä perustetaan ja yhteistä kotia aletaan rakentamaan, mutta yllättäen tapahtuu jotain, mikä muuttaa kaiken. Se jokin voi olla vaikkapa ero tai kuolemantapaus. Selvää kuitenkin on, että monesti tällaisissa tapauksissa koti menee myyntiin. Yllättäen tulevat tilanteet ovat hankalia siinä mielessä, että kiireessä ihminen ei aina toimi järkevästi. Asunnon myyminen kiireessä onkin yleensä huono idea. Miten tällaisissa tilanteissa voisi sitten toimia? Kaikista tärkeintä on rauhoittaa tilanne hetkeksi ja miettiä parasta mahdollista ratkaisua kaikkien kannalta.</p><p>&nbsp;</p><p>Kun asunto on tarkoitus saada myytyä mahdollisimman nopeasti, tulee pyyntihinnaksi yleensä laitettua kohtalaisen alhainen hinta. Monestikaan nopealla aikataululla myydyistä asunnoista ei saa sellaista summaa, johon myyjä voisi olla tyytyväinen. Toisaalta alhainen hinta saattaa jopa vähentää kiinnostuneiden ostajien määrää, sillä asunnossa voidaan ajatella olevan jotakin vikaa, jonka vuoksi siitä halutaan päästä nopeasti eroon.</p><p>&nbsp;</p><p>Asunnon myyminen vaatii tiettyjä seikkoja myös lain puolesta. Lain määräämät asiakirjat täytyy toimittaa ostajalle ennen kuin varsinainen kauppa voidaan toteuttaa. Asiakirjojen saaminen ja läpikäyminen vie tietysti oman aikansa. Moni kiireessä asuntoa myyvä saattaakin unohtaa, kylläkin vahingossa, joitakin asiakirjoja. Tällainen unohtaminen voi kostautua tulevaisuudessa, jos ostaja huomaa puutteita saaduissa asiakirjoissa. Pahimmillaan tällaiset virheet voivat johtaa jopa koko kaupan perumiseen.</p>', 'Asunnon myynti kiireessä', 10, '1588279737_contact-banner.png', NULL, '2020-01-23 19:08:53', '2020-05-09 04:46:51');
