INSERT INTO `frontend_pages_content` (`id`, `page_id`, `lang_code`, `language_id`, `html_element_id`, `html_content`, `created_at`, `updated_at`) VALUES
(2, 1, 'fi', 1, NULL, '<div class=\"banner\"><img src=\"http://test.flipkoti.fi/images/buying-bg.jpg\" />\n<div class=\"content\">\n<h1><span>Löydä unelmiesi asunto</span></h1>\n</div>\n</div>\n\n<div class=\"container padding-60\">\n<div class=\"home-info\">\n<p class=\"text-center\">Ongelmia löytää asunto oikealla sijainnilla ja vaatimuksilla?<br />\nAsunnon kunto ja budjettisi eivät kohtaa?</p>\n</div>\n</div>\n\n<section class=\"about-section buying right-align\">\n<div class=\"container padding-100\">\n<div class=\"row gutters-60\">\n<div class=\"col-md-5\">\n<h2>Oletko etsimässä unelmiesi kotia, mutta markkinoilta ei löydy sopivaa asuntoa?\')</h2>\n\n<div class=\"info\">\n<p>Oletko koskaan miettinyt, että asuntosi arvo voisi olla jotakin ihan uuta ammattimaisesti remontoituna ja markkinoituna? Et kenties ole tarkalleen tiennyt miten remontti ja markkinointi kannattaisi tehdä, jotta saisit asunnostasi parhaan tuoton.</p>\n\n<p>Tulit oikeaan paikkaan, meillä on tarjota sinulle ratkaisuja.</p>\n\n<p>Kerro meille tulevan kotisi vaatimukset, niin me etsimme puolestasi mieltymyksiisi ja budjettiisi sopivan ratkaisun. Jos olet jo löytänyt joitakin vaihtoehtoja, voit linkata ne meille analysoitavaksi.</p>\n\n<p>Meillä yli 10 vuoden kokemus muokata tarjolla olevista asunnoista kunkin henkilön tilanteeseen sopiva koti.</p>\n\n<p>Etsitään sinulle Koti jossa haluat elää, koti joka on taloudellisesti järkevä!</p>\n</div>\n</div>\n\n<div class=\"col-md-7\">\n<div class=\"img-box\"><img src=\"http://test.flipkoti.fi/images/buying.jpg\" /></div>\n</div>\n</div>\n</div>\n</section>\n\n<section class=\"investing-work howtoRenovate\">\n<div class=\"container\">\n<h3>Näin löydät unelmiesi asunnon</h3>\n\n<div class=\"grid\">\n<div class=\"item\"><i class=\"icon-display-cart\"></i>\n\n<p>Täytä asuntokriteerit alla olevaan lomakkeeseen ja jätä anonyymi osto-ilmoitus.</p>\n</div>\n\n<div class=\"item\"><i class=\"icon-hand-chat\"></i>\n\n<p>Pyydämme tarvittaessa tarkentavia kysymyksiä.</p>\n</div>\n\n<div class=\"item\"><i class=\"icon-chart-search\"></i>\n\n<p>Analysoimme pyyntösi ja etsimme kriteerit täyttäviä asuntoja.</p>\n</div>\n\n<div class=\"item\"><i class=\"icon-refresh1\"></i>\n\n<p>Esittelemme flip -potentiaalit sekä valmiiksi kriteerejäsi vastaavat kohteet.</p>\n</div>\n\n<div class=\"item\"><i class=\"icon-sales-price\"></i>\n\n<p>Valitaan paras vaihtoehto yhdessä. Palvelun hinta kaupan toteutuessa on 1% velattomasta myyntihinnasta.</p>\n</div>\n\n<div class=\"item\"><i class=\"icon-lovely-home\"></i>\n\n<p>Muuta unelmiesi kotiin!</p>\n</div>\n\n<div class=\"arrows\"><i class=\"icon-nextline\"></i> <i class=\"icon-nextline\"></i></div>\n</div>\n</div>\n</section>', '2020-05-02 12:50:25', '2020-05-05 01:29:03'),
(4, 1, 'en', 1, NULL, '<div class=\"banner\"><img src=\"http://test.flipkoti.fi/images/buying-bg.jpg\" />\n<div class=\"content\">\n<h1><span>Löydä unelmiesi asunto</span></h1>\n</div>\n</div>\n\n<div class=\"container padding-60\">\n<div class=\"home-info\">\n<p class=\"text-center\">Ongelmia löytää asunto oikealla sijainnilla ja vaatimuksilla?<br />\nAsunnon kunto ja budjettisi eivät kohtaa?</p>\n</div>\n</div>\n\n<section class=\"about-section buying right-align\">\n<div class=\"container padding-100\">\n<div class=\"row gutters-60\">\n<div class=\"col-md-5\">\n<h2>Oletko etsimässä unelmiesi kotia, mutta markkinoilta ei löydy sopivaa asuntoa?\')</h2>\n\n<div class=\"info\">\n<p>Oletko koskaan miettinyt, että asuntosi arvo voisi olla jotakin ihan uuta ammattimaisesti remontoituna ja markkinoituna? Et kenties ole tarkalleen tiennyt miten remontti ja markkinointi kannattaisi tehdä, jotta saisit asunnostasi parhaan tuoton.</p>\n\n<p>Tulit oikeaan paikkaan, meillä on tarjota sinulle ratkaisuja.</p>\n\n<p>Kerro meille tulevan kotisi vaatimukset, niin me etsimme puolestasi mieltymyksiisi ja budjettiisi sopivan ratkaisun. Jos olet jo löytänyt joitakin vaihtoehtoja, voit linkata ne meille analysoitavaksi.</p>\n\n<p>Meillä yli 10 vuoden kokemus muokata tarjolla olevista asunnoista kunkin henkilön tilanteeseen sopiva koti.</p>\n\n<p>Etsitään sinulle Koti jossa haluat elää, koti joka on taloudellisesti järkevä!</p>\n</div>\n</div>\n\n<div class=\"col-md-7\">\n<div class=\"img-box\"><img src=\"http://test.flipkoti.fi/images/buying.jpg\" /></div>\n</div>\n</div>\n</div>\n</section>\n\n<section class=\"investing-work howtoRenovate\">\n<div class=\"container\">\n<h3>Näin löydät unelmiesi asunnon</h3>\n\n<div class=\"grid\">\n<div class=\"item\"><i class=\"icon-display-cart\"></i>\n\n<p>Täytä asuntokriteerit alla olevaan lomakkeeseen ja jätä anonyymi osto-ilmoitus.</p>\n</div>\n\n<div class=\"item\"><i class=\"icon-hand-chat\"></i>\n\n<p>Pyydämme tarvittaessa tarkentavia kysymyks