(287, 'Watch more', '2020-04-21 11:34:33', '2020-04-21 11:34:33'),
(288, 'Flipkoti originated from a dream where the housing sector would become truly customer-oriented. One where buying, renovating and selling a home would not cause a headache.', '2020-04-21 11:44:08', '2020-04-21 11:44:08'),
(289, 'We integrated the industry’s ecosystem in a new way, making it more transparent, cost-effective and high quality.', '2020-04-21 11:45:24', '2020-04-21 11:45:24'),
(290, 'The successful operating methods, technology and carefully selected network developed over the years are now harnessed to serve you.', '2020-04-21 11:46:40', '2020-04-21 11:46:40'),
(291, 'For your home.', '2020-04-21 11:47:23', '2020-04-21 11:47:23'),
(292, 'With Flipkod, an apartment buyer can find an apartment that suits their preference and budget in the area they want.', '2020-04-21 11:49:39', '2020-04-21 11:49:39'),
(293, 'Better return on your capital', '2020-04-21 12:15:04', '2020-04-21 12:15:04'),
(294, 'You can now become a home investor with little capital, decentralized risk, without the worry and hassle of renting homes or developing value.', '2020-04-21 12:16:40', '2020-04-21 12:16:40'),
(295, 'Flipkoti helps small and large players to invest in housing while maximizing income.', '2020-04-21 12:18:24', '2020-04-21 12:18:24'),
(296, 'Acquisition of housing', '2020-04-21 12:20:17', '2020-04-21 12:20:17'),
(297, 'Browse apartments', '2020-04-21 12:22:01', '2020-04-21 12:22:01'),
(298, 'Investing', '2020-04-21 12:22:59', '2020-04-21 12:22:59'),
(299, 'Raise your returns', '2020-04-21 12:24:08', '2020-04-21 12:24:08'),
(300, 'Flipkod\'s experts and network are looking for apartments all over Finland and, in the future, also internationally. We only make investments if we invest ourselves. In this way, we want to show that the investments are carefully analyzed and we only make investments when we know what we are buying and what the investment will do.', '2020-04-21 12:26:02', '2020-04-21 12:26:02'),
(301, 'When making a purchase decision, Flipkoti analyzes the investment object technically and financially. Taking into account regional development as well as technical risks. Once the technical and financial risks have been analyzed and the site has been found to meet the criteria, we will take the site from our platform. We publish the property to our investors with calculations and plans. We make an investment when willing investors have been found in the property.', '2020-04-21 12:27:35', '2020-04-21 12:27:35'),
(302, 'You can let us know your willingness by contacting us or joining the investor list. It doesn\'t bind you to anything. You will receive information about the items we have mapped in your e-mail, and you will decide for yourself whether you want to invest or not. We have items from multiple locations, so you can diversify your portfolio by selecting items from different regions.', '2020-04-21 12:29:26', '2020-04-21 12:29:26'),
(303, 'You can increase your returns immediately after selling a Flip item. Or raise rental income, for example, once a month. You decide on the use of your income.', '2020-04-21 12:30:37', '2020-04-21 12:30:37'),
(304, 'The duration of the investment is determined on a site-by-site basis. We aim for a fast turnover of investments and thus a high annual return on capital.', '2020-04-21 12:31:51', '2020-04-21 12:31:51'),
(305, 'If you wish, you can also leave your funds (investment and return) in an account managed by us for future investments, in which case you will be given priority over investors in new properties.', '2020-04-21 12:33:09', '2020-04-21 12:33:09'),
(306, 'An easy way to invest and diversify risk', '2020-04-21 12:36:04', '2020-04-21 12:36:04'),
