(28, 'Kotiasi varten', 28, 1, '2020-04-11 01:52:32', '2020-04-11 01:52:32'),
(29, 'Flipkoti sai alkunsa unelmasta, missä asumisen ala muuttuisi aidosti asiakaslähtöiseksi. Sellaiseksi, jossa asunnon osto, remontointi ja myynti eivät aiheuttaisi päänsärkyä.  Yhdistimme alan ekosysteemin uudella tavalla, mikä tekee siitä läpinäkyvämmän, kustannustehokkaamman ja laadukkaamman.  Vuosien saatossa kehittyneet tuloksekkaat toimintatavat, teknologia ja tarkkaan valikoitu verkosto on nyt valjastettu palvelemaan Sinua.  Sinun kotiasi varten.', 29, 1, '2020-04-11 01:56:34', '2020-04-11 01:56:34'),
