(86, 'Myy asuntosi kahdella hinnalla. Tai flippaa koti ennen myyntiä. Avullamme se on helppoa ja kannattavaa.', 86, 1, '2020-04-16 05:51:42', '2020-04-16 05:51:42'),
(87, 'Oletko koskaan miettinyt, että asuntosi arvo voisi olla jotakin ihan muuta ammattimaisesti remontoituna ja markkinoituna? Et kenties ole tarkalleen tiennyt miten remontti ja markkinointi kannattaisi tehdä, jotta saisit asunnostasi parhaan tuoton.', 87, 1, '2020-04-16 05:52:23', '2020-04-16 05:52:23'),
