(89, 'Me Flipkodilla olemme tehneet asuntokauppaa flippaamalla, eli osta-remontoi-myy -mallilla, jo yli 10 vuotta ja tiedämme sen olevan totta. Järkevästi toteutettu remontti useimmiten kannattaa vastoin alan yleistä käsitystä.', 89, 1, '2020-04-16 05:53:40', '2020-04-16 05:53:40'),
(90, 'Nyt olemme organisoineet toimintatapamme helposti ostettaviksi palvelupaketeiksi, jonka avulla sinä voit maksimoida asuntosi arvon erilaisissa myyntitilanteissa. Voit myös myydä asuntosi suoraan meille, jos haluat vain päästä siitä nopeasti eroon.', 90, 1, '2020-04-16 05:54:14', '2020-04-16 05:54:14'),
(91, 'Olipa tilanteesi mikä hyvänsä, Flipkoti auttaa löytämään siihen järkevimmän ratkaisun.', 91, 1, '2020-04-16 05:54:40', '2020-04-16 05:54:40'),
