(139, 'Oletko koskaan miettinyt, että asuntosi arvo voisi olla jotakin ihan uuta ammattimaisesti remontoituna ja markkinoituna? Et kenties ole tarkalleen tiennyt miten remontti ja markkinointi kannattaisi tehdä, jotta saisit asunnostasi parhaan tuoton.', 139, 1, '2020-04-19 04:32:03', '2020-04-19 04:32:03'),
(140, 'Tulit oikeaan paikkaan, meillä on tarjota sinulle ratkaisuja.', 140, 1, '2020-04-19 04:32:40', '2020-04-19 04:32:40'),
(141, 'Kerro meille tulevan kotisi vaatimukset, niin me etsimme puolestasi mieltymyksiisi ja budjettiisi sopivan ratkaisun. Jos olet jo löytänyt joitakin vaihtoehtoja, voit linkata ne meille analysoitavaksi.', 141, 1, '2020-04-19 04:33:15', '2020-04-19 04:33:15'),
