(156, 'Flipkodin missio on muuttaa asumisen alan painopiste aidosti asiakkaan puolelle – sinne missä sen kuuluisikin olla. Kehitämme helppokäyttöistä teknologiaa, laatutarkistettuja verkostoja ja parempia toimintatapoja, joiden avulla asiakas voi oikeasti olla ykkönen.', 156, 1, '2020-04-19 04:53:56', '2020-04-19 04:53:56'),
