(288, 'Flipkoti sai alkunsa unelmasta, missä asumisen ala muuttuisi aidosti asiakaslähtöiseksi. Sellaiseksi, jossa asunnon osto, remontointi ja myynti eivät aiheuttaisi päänsärkyä.', 288, 1, '2020-04-21 06:14:09', '2020-04-21 06:14:09'),
