(300, 'Flipkodin asiantuntijat ja verkosto etsivät asuntoja ympäri Suomen ja tulevaisuudessa myös kansainvälisesti. Teemme sijoituksia vain, jos itsekin sijoitamme. Näin haluamme osoittaa, että sijoitukset ovat huolella analysoituja ja me teemme sijoituksia vain, kun tiedämme, mitä olemme ostamassa ja mitä sijoituksella tullaan tekemään.', 300, 1, '2020-04-21 06:56:03', '2020-04-21 06:56:03'),
(301, 'Hankintapäätöstä tehdessä Flipkoti analysoi sijoituskohdetta teknisesti ja taloudellisesti. Ottaen huomioon alueellisen kehittymisen kuin myös tekniset riskit. Kun tekniset ja taloudelliset riskit on analysoitu ja kohde todettu kriteerit täyttäväksi, otamme kohteen alustaamme. Julkaisemme kohteen sijoittajillemme laskelmin ja suunnitelmin.Teemme sijoituksen, kun kohteeseen on löydetty halukkaat sijoittajat.', 301, 1, '2020-04-21 06:57:35', '2020-04-21 06:57:35'),
(302, 'Voit ilmoittaa meille halukkuutesi joka ottamalla meihin yhteyttä tai liittymällä investoijalistalle. Se ei sido sinua mihinkään. Saat meidän kartoittamista kohteista tietoa sähköpostiisi, ja päätät itse haluatko sijoittaa vai et. Meillä on kohteita useilta paikkakunnilta, joten voit hajauttaa salkkuasi valitsemalla kohteita eri alueilta.', 302, 1, '2020-04-21 06:59:26', '2020-04-21 06:59:26'),
(303, 'Voit nostaa tuottosi välittömästi Flipkohteen myynnin jälkeen. Tai nostaa vuokratuotot esim kerran kuukaudessa. Sinä päätät tuottojesi käytöstä.', 303, 1, '2020-04-21 07:00:37', '2020-04-21 07:00:37'),
(304, 'Sijoituksen kesto määritellään kohdekohtaisesti. Tavoittelemme sijoitusten nopeaa kiertoa ja tätä kautta korkeaa vuosittaista pääomantuottoa.', 304, 1, '2020-04-21 07:01:51', '2020-04-21 07:01:51'),
(305, 'Voit jättää halutessasi myös varasi (sijoitus ja tuotto) meidän hallinnoimalle tilille jatkosijoituksia varten, jolloin olet etusijalla uusien kohteiden sijoittajista.', 305, 1, '2020-04-21 07:03:09', '2020-04-21 07:03:09'),
