ss=\"small\" id=\"total_brokerage\">&euro; 3000</h3>\r\n                              </div>\r\n                              <div class=\"col-sm-4\">\r\n                                 <p class=\"small\">Monthly cost</p>\r\n                                 <h3 class=\"small\" id=\"total_monthly_cost\">&euro; 900</h3>\r\n                              </div>\r\n                           </div>\r\n                        </div>\r\n                     </div>\r\n                  </div>\r\n                  <p class=\"text-center\">We recommend to use ensure the real potential of your apartment by continuing calculator</p>\r\n                  <a href=\"javascript:void(0)\" class=\"btn btn-primary conbtn\">Continue&nbsp;></a>\r\n               </div>\r\n            </div>\r\n         </form>\r\n         <!-- <p class=\"text-center know\">Know more about flipping Appartments <span>?</span></p> -->            \r\n      </div>\r\n      <a href=\"#\" class=\"more\"></a>\r\n   </div>\r\n</section>\r\n<section class=\"services-section\">\r\n   <div class=\"container padding-40\">\r\n      <img class=\"services-logo\" src=\"http://test.flipkoti.fi/images/flipkoti-pro.png\">\r\n      <h2>Flipkoti ammattilaisille</h2>\r\n      <p>Flipkoti tarjoaa mahdollisuuksia, työkaluja ja laajan verkoston asumisen alan eri ammattilaisille. Halusitpa tarjota remonttipalvelua, sijoittaa kiinteistöihin tai laittaa taloyhtiön asiat kuntoon, meillä on tarjota hyviä ratkaisuja.</p>\r\n      <div class=\"gird\">\r\n         <div class=\"item\">\r\n            <div class=\"image\">\r\n               <img src=\"http://test.flipkoti.fi/images/img7.jpg\">\r\n            </div>\r\n            <div class=\"text\">\r\n               <h3>Palveluntarjoajalle</h3>\r\n               <p>Työt, materiaalit ja liiketoiminnan työkalut yhdestä paikasta.</p>\r\n               <a href=\"#\">Lue lisää <i class=\"icon-right-arrow-long\"></i></a>\r\n            </div>\r\n         </div>\r\n         <div class=\"item\">\r\n            <div class=\"image\">\r\n               <img src=\"http://test.flipkoti.fi/images/img8.jpg\">\r\n            </div>\r\n            <div class=\"text\">\r\n               <h3>Kiinteistöille &amp; taloyhtiöille</h3>\r\n               <p>Kustannustehokas digihallinto, remonttien, huollon ja ylläpidon kilpailutukset sekä paljon muuta. Ota kiinteistön ja taloyhtiön hoitodossa kanssamme digiloikka tähän päivään.</p>\r\n               <a href=\"#\">Lue lisää <i class=\"icon-right-arrow-long\"></i></a>\r\n            </div>\r\n         </div>\r\n         <div class=\"item\">\r\n            <div class=\"image\">\r\n               <img src=\"http://test.flipkoti.fi/images/img9.jpg\">\r\n            </div>\r\n            <div class=\"text\">\r\n               <h3>Sijoittamassa asuntoihin</h3>\r\n               <p>Uusi ja huoleton tapa sijoittaa asuntoihin. Saat pääomallesi loistavan vuosituoton verrattuna perinteiseen vuokratuottomalliin.</p>\r\n               <a href=\"#\">Tutustu ratkaisuumme <i class=\"icon-right-arrow-long\"></i></a>\r\n            </div>\r\n         </div>\r\n      </div>\r\n   </div>\r\n</section>\r\n{{blog_section}}', '2020-05-01 05:23:24', '2020-05-02 02:32:39'),
