(6, 'North Rantakatu 14 B 4', 'Eerikinkatu 43, Kamppi', 'North-Rantakatu-14-B-4', 'Kerrostalo', 'Studio located at the end of Eerikinkatu, in a quiet courtyard. The second floor home of the funk house is now looking for a new occupant. Elegant light-colored surfaces and floor plan give the apartment a larger feel than its square footage. Best location near good transport links and services. You can\'t but fall in love with this!', 'Helsinki, Kamppi, 00180', 'Eerikinkatu 43', '32.0 m2', '1h, K', 285000, 1223, 'Erika Sihtola', 2015, 5, 200, 200, 'Rented', '3250 m2', 'Yes', 28500, 5000, 10000, 10000, '2019-11-02 18:36:55', '2020-01-05 19:06:24', NULL),
(8, 'LAIVANVARUSTAJANKATU 6,', 'ULLANLINNA, HELSINKI,', 'LAIVANVARUSTAJANKATU-6', 'Kerrostalo', 'This light and spacious one-story home, extensively updated to the present day, awaits its new residents in the village of Vihti, Männikö. In this huge gated courtyard you grow, for example, a whole vineyard, with enough flat lawn here. In addition to crying on a grassy evening, you will certainly enjoy your glazed large terrace.', 'Vihti, Männikko, 03400', 'Ditchfield Path 1', '111.0 m 2', '4h, k, khh, 2 toilets, s, vh, garage, sun terrace', 85850, 87, 'TANJA PIIRAINEN', 1920, 3254, 200, 200, 'Yes', '354 m 2', 'Yes', 350000, 365777, 500, 0, '2019-11-14 21:53:59', '2020-01-05 19:06:36', NULL),
(9, 'SKUTHOLMINKAARI 1', 'Sukh Villa', 'SKUTHOLMINKAARI-1', 'Omakotitalo', 'Soft tones, casual cosiness, high quality elegance!\r\n\r\nEverything and more is offered by this detached house on Karhusaari, Helsinki, on a magnificent 2151m2 plot.\r\n\r\nThe house is designed for a relaxed stay at sea, a dinner party, and a cozy everyday life for the family.\r\n\r\nAll functions and choices are made for ease of care, starting from home; mm. electric gate, paved driveway, paved driveways, spacious lawn area (maintained by a robot in the current family) and gorgeous seating, two-car large garage and gorgeous terrace.', 'Helsinki, Bear Island, 00890', 'Arch of Skutholm 1', '221.0 m 2', '6-7h + k + kph / s + at', 685000, 123, 'MIA LEHTONEN', 2002, 4079, 200, 200, 'Sukhi', '221.0 m 2', 'Yes', 285000, 365777, 10000, 1, '2019-11-14 22:09:02', '2020-01-05 19:06:50', NULL);
